import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Header from './Header';
import RegistrationForm from './RegistrationForm';

function App() {
  return (
    <Router>
      <div>
        <Header />
        <RegistrationForm />
      </div>
    </Router>
  );
}

export default App;
